/* eslint-disable @typescript-eslint/no-unused-vars */
import './App.css';

function App() {
  const name:string = 'Benevanio';
  // eslint-disable-next-line @typescript-eslint/no-unused-vars
  interface User{
    name:string;
    age:number;
    id:string;
    work:boolean;

  }
  const user:User = {
    name: 'Benevanio',
    age: 30,
    id: '1',
    work: true
  }
  //say hy
  const message =(name:string): string =>{
    return `Hello ${name}`;
  }
  return (
    <div className="App">
      <header className="App-header">

        <nav>
          <a href="#">Home</a>
          <a href="#">About</a>
          <a href="#">Contact</a>

        </nav>
        </header>
      <table>
        <thead>
          <tr>
            <th>Nome</th>
            <th>Idade</th>
            <th>Id</th>
            <th>Trabalha</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{user.name}</td>
            <td>{user.age}</td>
            <td>{user.id}</td>
            <td>{user.work}</td>
          </tr>
        </tbody>
      </table>


      </div>


  );
}

export default App;
